script: |
  super -f text -I q10859.spq | sort > q10859.out

inputs:
  - name: q10859.spq
    data: |
      SELECT col2 AS col1 FROM tab2 (FORMAT parquet) WHERE NOT ( - - 90 ) BETWEEN col2 * + col1 - + col0 + - col0 + - 40 * + + col1 + - - 51 AND NULL;
  - name: tab2

outputs:
  - name: q10859.out
    data: |
      58
